import * as React from 'react';
import CssBaseline from '@mui/material/CssBaseline';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Container from '@mui/material/Container';
import Toolbar from '@mui/material/Toolbar';
import Paper from '@mui/material/Paper';
import Typography from '@mui/material/Typography';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';

export default function Application() {
    const [fullName, setFullName] = React.useState('');
    const [preferredPronoun, setPreferredPronoun] = React.useState('');
    const [studentId, setStudentId] = React.useState('');
    const [major, setMajor] = React.useState('');
    const [minor, setMinor] = React.useState('');
    const [gpa, setGpa] = React.useState('');
    const [currentYear, setCurrentYear] = React.useState('');
    const [ethnicity, setEthnicity] = React.useState('');
    const [personalStatement, setPersonalStatement] = React.useState('');
    const [workExperience, setWorkExperience] = React.useState('');

    const handleSubmit = async (event: React.FormEvent) => {
        event.preventDefault();
        try {
            const response = await fetch('http://localhost:8000/createapplication/', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify({
                    fullName,
                    preferredPronoun,
                    studentId,
                    major,
                    minor,
                    gpa,
                    currentYear,
                    ethnicity,
                    personalStatement,
                    workExperience,
                }),
            });

            if (response.ok) {
                const data = await response.json();
                console.log('Form submitted successfully:', data);
                // You might want to update your component's state here, or redirect the user to another page
            } else {
                const errorData = await response.json();
                console.error('Form submission error:', errorData);
                // You might want to update your component's state here to show an error message
            }
        } catch (error) {
            console.error('Network error:', error);
            // You might want to update your component's state here to show an error message
        }
    };

    return (
        <React.Fragment>
            <CssBaseline />
            <AppBar position="static">
                <Toolbar>
                    <Typography variant="h6" color="inherit" noWrap>
                        Scholarship Application
                    </Typography>
                </Toolbar>
            </AppBar>
            <Container component="main" maxWidth="sm" sx={{ mt: 4 }}>
                <Paper variant="outlined" sx={{ p: 4 }}>
                    <Typography component="h1" variant="h4" align="center" sx={{ mb: 4 }}>
                        Apply for Scholarship
                    </Typography>
                    <form onSubmit={handleSubmit}>
                        <TextField
                            required
                            label="Full Name"
                            fullWidth
                            value={fullName}
                            onChange={(event) => setFullName(event.target.value)}
                            sx={{ mb: 2 }}
                        />
                        <TextField
                            label="Preferred Pronoun"
                            fullWidth
                            value={preferredPronoun}
                            onChange={(event) => setPreferredPronoun(event.target.value)}
                            sx={{ mb: 2 }}
                        />
                        <TextField
                            required
                            label="Student ID"
                            fullWidth
                            value={studentId}
                            onChange={(event) => setStudentId(event.target.value)}
                            sx={{ mb: 2 }}
                        />
                        <TextField
                            required
                            label="Major"
                            fullWidth
                            value={major}
                            onChange={(event) => setMajor(event.target.value)}
                            sx={{ mb: 2 }}
                        />
                        <TextField
                            label="Minor"
                            fullWidth
                            value={minor}
                            onChange={(event) => setMinor(event.target.value)}
                            sx={{ mb: 2 }}
                        />
                        <TextField
                            required
                            label="Cumulative GPA"
                            fullWidth
                            value={gpa}
                            onChange={(event) => setGpa(event.target.value)}
                            sx={{ mb: 2 }}
                        />
                        <TextField
                            required
                            label="Current Year"
                            fullWidth
                            value={currentYear}
                            onChange={(event) => setCurrentYear(event.target.value)}
                            sx={{ mb: 2 }}
                        />
                        <TextField
                            required
                            label="Ethnicity"
                            fullWidth
                            value={ethnicity}
                            onChange={(event) => setEthnicity(event.target.value)}
                            sx={{ mb: 2 }}
                        />
                        <TextField
                            required
                            label="Personal Statement Essay"
                            fullWidth
                            multiline
                            rows={4}
                            value={personalStatement}
                            onChange={(event) => setPersonalStatement(event.target.value)}
                            sx={{ mb: 2 }}
                        />
                        <TextField
                            label="Work Experience"
                            fullWidth
                            multiline
                            rows={4}
                            value={workExperience}
                            onChange={(event) => setWorkExperience(event.target.value)}
                            sx={{ mb: 2 }}
                        />
                        <Button type="submit" variant="contained" fullWidth>
                            Submit Application
                        </Button>
                    </form>
                </Paper>
            </Container>
        </React.Fragment>
    );
}
